ControlPropertyState.AutoRuleBindingString:
// Reset varUser and StageIDList variables after navigation
    Set(varUser, Blank());
    Clear(colStageIDs);

Set(
    varUser,
    LookUp(
        ECN_UserMaster,
        User_Login_ID = InputUsername_1.Text && User_Login_Password = InputPassword_1.Text
    )
);

If(
    IsBlank(varUser),
    Notify("Invalid user ID or Password", NotificationType.Error);
    Set(varerrorvisible, true),

    // Collect the list of Stage IDs associated with the user's roles
    ClearCollect(
        colStageIDs,
        Distinct(
            Filter(
                ECN_UserDetails,
                User_Id.Value = varUser.User_Id
            ).Stage_Id,
            Stage_Id.Id
        )
    );

    // Navigate to the home screen, passing the list of Stage IDs
    ClearCollect(UserRolesAndStages, Filter(ECN_UserDetails, User_Id.Value = varUser.User_Id));
    Set(varIsLogin, !varIsLogin);
    Navigate(frmHome, ScreenTransition.Fade, {StageIDList: colStageIDs,UserRolesAndStages:UserRolesAndStages})
);

Reset(InputUsername_1);
Reset(InputPassword_1);
